INSERT INTO `eventapp_events` VALUES (1,'event_cover/3.jpg','IDEATE! ','NIT Warangaly','<p><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\">Summary</span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\">Have you ever wondered how self-driving cars work? Have you ever wanted to land a highly paid job in Computer Vision industry? </span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\">We have compiled this workshop so you seize your opportunity to get noticed by building awesome Computer Vision applications.This course kicks-off with Introduction to OpenCV and familiarizes you with the advancements in this version. We&rsquo;ll educate you on how to handle images, enhance and transform them. We&rsquo;ll also develop some cool applications including Face and Eyes detection, Emotion recognition and Fast QR code detection &amp; decoding that you can deploy anywhere. We&rsquo;ll also share some tips &amp; tricks to make you more productive.</span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\">By the end of the workshop, you will have profound knowledge on what Computer Vision is and how we can leverage OpenCV to build real-world applications without much effort.</span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\">You will learn</span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\"> 1. How to build real-world Computer Vision applications.</span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\"> 2. Deploy Face and Eyes Detection with HAAR Cascade </span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\"> Classifiers.</span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\"> 3. Recognize Age, Gender and Emotions .</span><br style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: #ffffff;\" /><span style=\"color: #1d2129; font-family: Helvetica, Arial, sans-serif; font-size: 14px; white-space: p